import React from "react";



const Home = ({success}) => {
  return (
    <>
      <h1>Home</h1>
      <p>{success}</p>
    </>
  )
};

export async function getServerSideProps(ctx) {
  return {props:{success:"Success!"}}
}


export default Home;
